  'AdminAdvparametersHelp' => 
  array (
    '-- Choose --' => '- Välj -',
    'or' => 'eller',
    'Use this option to associate data (products, modules, etc.) the same way for each selected shop.' => 'Använd detta alternativ för att associera (produkter, moduler, etc.) på samma sätt som för den valda butiken',
    'Click here to display the shops in the %name% shop group' => 'Klicka här för att visa butikerna i gruppen %name%',
    'Click here to display the URLs of the %name% shop' => 'Klicka här för att visa URL: erna för butik %name%',
    'Click here to display the list of shop groups' => 'Klicka här för att visa butiksgrupper',
    'Warning: Enabling the "share customers" and "share orders" options is not recommended. Once activated and orders are created, you will not be able to disable these options. If you need these options, we recommend using several categories rather than several shops.' => 'Varning: det är inte rekommenderat att aktivera "dela kunder" och "dela ordrar", eftersom när de väl blivit aktiverade och kunder samt beställningar skapats kommer du inte kunna stänga av dessa inställningar. Om du är i behov av dessa inställningar, fundera först på om du kan utgå från flera olika kategorier istället för olika butiker.',
    'Once this option is enabled, the shops in this group will share customers. If a customer registers in any one of these shops, the account will automatically be available in the others shops of this group.' => 'Så fort det här valet är aktiverat så kommer butikerna i den här gruppen att dela kunder. Om en kund registrerar sig i någon av de här butikerna, så kommer kontot att vara tillgängligt i övriga butiker i samma grupp.',
    'Warning: you will not be able to disable this option once you have registered customers.' => 'Varning: du kan inte inaktivera det här valet när du har registrerade kunder.',
    'Once this option is enabled (which is only possible if customers and available quantities are shared among shops), the customer\'s cart will be shared by all shops in this group. This way, any purchase started in one shop will be able to be completed in another shop from the same group.' => 'Så fort det här valet är aktiverat (vilket bara är möjligt om kunder och lager delas mellan butiker), så kommer kundernas varukorgar att delas mellan alla butiker i den här gruppen. Ett köp som har påbörjats i en butik, kan slutföras i en annan i samma grupp.',
    'Warning: You will not be able to disable this option once you\'ve started to accept orders.' => 'Varning: Du kan inte inaktivera det här valet när du fått in order.',
    'Enable or disable this shop group?' => 'Aktivera eller inaktivera den här butiksgruppen?',
    'If you want to add a virtual URL, you need to activate URL rewriting on your web server and enable Friendly URL option.' => 'Om du vill lägga till en virtuell URL så måste du aktivera URL-omskrivning på server och aktivera alternativet för SEO-vänlig URL.',
    'You can use this option if you want to create a store with a URL that doesn\'t exist on your server (e.g. if you want your store to be available with the URL www.example.com/my-store/shoes/, you have to set shoes/ in this field, assuming that my-store/ is your Physical URL).' => 'Du kan använda denna inställning om du vill skapa en butik med en annan URL som inte existerar på din server (t.ex. om du vill att din butik skall vara tillgänglig med följande URL: www.my-prestashop.com/min-butik/skor/, måste du sätta skor/ i detta fält, där vi antar att min-butik/ är din fysiska adress).',
    'URL rewriting must be activated on your server to use this feature.' => 'URL-omskrivning måste vara aktiverat på din server för att du ska kunna använda denna funktion.',
    'If you set this URL as the Main URL for the selected shop, all URLs set to this shop will be redirected to this URL (you can only have one Main URL per shop).' => 'Om du anger den här URL:en som Standard URL för den valda butiken, kommer alla URL:er som valts för den här butiken omdirigeras till den här URL:en (du kan endast en Standard URL per butik)',
    'Since the selected shop has no main URL, you have to set this URL as the Main URL.' => 'Eftersom butiken inte har någon Standard URL, måste du ange en URL som Standard URL.',
    'The selected shop already has a Main URL. Therefore, if you set this one as the Main URL, the older Main URL will be set as a regular URL.' => 'Den valda butiken har redan en huvud-URL. Om du sätter den här som huvud-URL, så kommer den gamla att ändras till en vanlig URL.',
    'This is the physical folder for your store on the web server. Leave this field empty if your store is installed on the root path. For instance, if your store is available at www.example.com/my-store/, you must input my-store/ in this field.' => 'Det här är den fysiska katalogen för din butik på webbservern. Lämna fältet tomt om butiken är installerad i rotkatalogen. Om din butik finns på www.example.com/min-butik/, så anger du my-store/ i det här fältet.',
    'Warning: URL rewriting (e.g. mod_rewrite for Apache) seems to be disabled. If your Virtual URL doesn\'t work, please check with your hosting provider on how to activate URL rewriting.' => 'Varning: URL omskrivning (t.ex. mod_rewrite för Apache) verkar vara inaktiverat. Om dina URL:er inte fungerar, vänligen kontakta din hostingleverantör för att aktivera URL-omskrivning.',
    'Ignore this field if you don\'t use the Multistore tool. If you leave this field empty, the default shop will be used.' => 'Ignorera detta fält om du inte använder Multibutiksstöd. Om du lämnar fältet tomt, kommer standardbutiken att användas',
    'A category root is where a category tree can begin. This is used with multistore.' => 'En kategorirot är där ett kategoriträd börjar, detta används om du aktiverat multishop',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes)' => 'Aktivera Avancerad lagerhantering på produkt (0 = Nej, 1 = Ja)',
    '0 = Use quantity set in product, 1 = Use quantity from warehouse.' => '0 = Använd kvantitet från produkt, 1 = Använd kvantitet från varulager.',
    'ID of the warehouse to set as storage.' => 'ID för varulagret som används.',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes).' => 'Aktivera Avancerad lagerhantering på produkt (0 = Nej, 1 = Ja).',
    'This will add directives to your .htaccess file, which should improve caching and compression.' => 'Detta kommer att lägga direktiven till din. Htaccess-fil som bör förbättra caching och komprimering.',
    'Enable or disable debug mode.' => 'Aktivera eller inaktivera felsökningsläget.',
    'Name of the second domain of your shop, (e.g. myshop-media-server-1.com). If you do not have another domain, leave this field blank.' => 'Namnet på den andra domänen för din butik, (t.ex. myshop-media-server-1.com). Om du inte har en annan domän, lämna fältet tomt',
    'Name of the third domain of your shop, (e.g. myshop-media-server-2.com). If you do not have another domain, leave this field blank.' => 'Namn på den tredje domänen för din butik, (t.ex. myshop-media-server-2.com). Om du inte har en annan domän, lämna fältet tomt',
    'Name of the fourth domain of your shop, (e.g. myshop-media-server-3.com). If you do not have another domain, leave this field blank.' => 'Namn på den fjärde domänen för din butik, (t.ex. myshop-media-server-3.com). Om du inte har en annan domän, lämna fältet tomt',
    'Choose "No" to disable Product Combinations.' => 'Välj "Nej" för att inaktivera Produkt Kombinationer.',
    'You cannot set this parameter to No when combinations are already used by some of your products' => 'Du kan inte sätta denna parameter till Nej när kombinationer redan används av några av dina produkter',
    'Choose "No" to disable Product Features.' => 'Välj "Nej" för att inaktivera Produktfunktioner.',
    'Choose "No" to disable Customer Groups.' => 'Välj "Nej" för att inaktivera kundgrupper.',
    'Should be enabled if you want to avoid to store the smarty cache on NFS.' => 'Ska aktiveras om du vill undvika att lagra smarty-cache på NFS.',
    'New modules and updates are displayed on the modules page.' => 'Nya moduler och uppdateringar visas på modulernas sida',
    'Check the IP address of the cookie in order to prevent your cookie from being stolen.' => 'Kontrollera IP-adressen av cookien för att undvika att din cookie blir stulen',
    'Set the amount of hours during which the front office cookies are valid. After that amount of time, the customer will have to log in again.' => 'Ställ in tiden i timmar för hur länge en kunds cookie är giltig. Efter den tiden måste kunden logga in på nytt.',
    'When you access your back office and decide to stay logged in, your cookies lifetime defines your browser session. Set here the number of hours during which you want them valid before logging in again.' => 'När du loggar in i admin och väljer att fortsätta vara inloggad, så är det cookiens "lifetime" som styr sessionen i browsern. Här kan du ställa in hur många timmar cookien ska vara giltig innan du måste logga in igen.',
    'Choose a stability level for the modules downloaded from the Addons Marketplace. All zips pushed on Addons are in stable state unless stated otherwise.' => 'Välj nivå av stabilitet för moduler som laddas ner från Addons Marketplace. Alla zipfiler på Addons är stabila om annat inte anges.',
    'Allows you to declare if your cookie should be restricted to a first-party or same-site context.' => 'Låter dig välha om din cookie ska vara begränsad till first-party eller same-site.',
    'Define the upload limit for a downloadable product (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Ange gränsen för storlek på en nerladdningsbar produkt (i megabyte). Värdet måste vara mindre eller lika stort som inställningen på servern (nuvarande: %size% MB).',
    'Define the upload limit for an image (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Ange gränsen för storleken på en bild (i megabyte). Värdet måste vara mindre eller lika stort som den maximala inställningen på servern (nuvarande: %size% MB).',
    'Set the maximum size allowed for attachment files (in megabytes). This value has to be lower than or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Ange den maximala storleken för bilagda filer (i megabyte). Detta värde måste vara lägre eller lika med inställningen på din server (nuvarande: %size% MB).',
    'Drop existing tables during import.' => 'Ta bort tabeller under import.',
    'If enabled, the backup script will drop your tables prior to restoring data. (ie. "DROP TABLE IF EXISTS")' => 'Om aktiverad, kommer backupskriptet att radera dina tabeller innan återställning av data. ("DROP TABLE IF EXISTS")',
    'Where customers send messages from the order page.' => 'När kunderna skickar meddelande från order-sidan.',
