    'IP address or server name (e.g. smtp.mydomain.com).' => 'IP-adress eller servernamn (t.ex. smtp.mydomain.com).',
    'Leave blank if not applicable.' => 'Lämna tomt om ej tillämpligt',
    'SSL does not seem to be available on your server.' => 'SSL verkar inte vara tillgängligt på din server.',
    'Port number to use.' => 'Portnummer att använda.',
    'If enabled, the product\'s reference number MUST be unique!' => 'Om aktiverad så MÅSTE produktens referensnummer vara unikt!',
