    'Enable this option to keep your imported items’ ID number as is. Otherwise, PrestaShop will ignore them and create auto-incremented ID numbers.' => 'Aktivera valet om du vill använda importerat ID som det är. Annars kommer PrestaShop att skapa nya autonumrerade ID-nummer.',
    'Receive an email when the import is complete. It can be useful when handling large files, as the import may take some time.' => 'Skickar ett e-postmeddelande så att du vet att importen är klar. Det kan vara användbart vid hantering av stora filer, eftersom importen kan ta lite tid.',
    'Click on "None" to disable log alerts by email or enter the recipients of these emails in the following field.' => 'Klicka på "Inga" för att inte skicka ut loggvarningar via mail, eller ange mottagare av dessa mail i följande fält.',
    'Log alerts will be sent to these emails. Please use a comma to separate them (e.g. pub@prestashop.com, anonymous@psgdpr.com).' => 'Loggvarningar kommer att skickas till dessa mailadresser. Använd kommatecken för att separera dem. (ex. pub@prestashop.com, anonymous@psgdpr.com).',
    'Before activating the webservice, you must be sure to: ' => 'Före aktivering av webbtjänsten måste du se till att: ',
