    'Mobile phone number for this supplier.' => 'Mobiltelefon till den här leverantören.',
    'Create a new product: CTRL+P' => 'Skapa en ny produkt: CTRL+P',
    'To have a different title from the category name, enter it here.' => 'För att använda annan titel än kategorins namn, ange det här.',
