    'Search for a product' => 'Sök produkt',
    'Enter your product name' => 'Ange ett produktnamn',
    'The summary is a short sentence describing your product.<br />It will appears at the top of your shop\'s product page, in product lists, and in search engines\' results page (so it\'s important for SEO). To give more details about your product, use the "Description" tab.' => 'Summeringen är en kort mening som beskriver din produkt.<br />Den visas på produktsidan, i produktlistan och hos sökmotorer (alltså viktig för SEO). För att ange mer detaljer om din produkt, använd fliken "Beskrivning".',
    'Search and add a related product' => 'Sök och lägg till en relaterad produkt',
    'Use a comma to create separate tags. E.g.: dress, cotton, party dresses.' => 'Använd kommatecken för att separera taggar. Ex. klänning, bomull.',
    'Per kilo, per litre' => 'Per kilo, per liter',
    'Combine several attributes, e.g.: "Size: all", "Color: red".' => 'Kombinera flera attribut, ex.: "Storlek: 38", "Färg: röd".',
    'Leave empty to disable' => 'Lämna tom för att inaktivera',
    'To have a different title from the product name, enter it here.' => 'För att använda en annan titel än produktnamnet, ange den här.',
    'Public title for the product\'s page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the left of the field.' => 'Titel för produktsidan och för sökmotorer. Lämna fältet tom för att använda produktnamnet. Antal återstående tecken visas till vänster om fältet.',
    'To have a different description than your product summary in search results pages, write it here.' => 'För att använda en annan beskrivning än produktbeskrivningen i sökresultat, ange den här.',
    'This description will appear in search engines. You need a single sentence, shorter than 160 characters (including spaces)' => 'Den här beskrivningen kommer att synas i sökmotorer. Du behöver en enda mening, kortare än 160 tecken (inklusive mellanslag)',
    'To which product the page should redirect?' => 'Vilken produkt ska sidan omdirigeras till?',
    'To which category the page should redirect?' => 'Till vilken kategori ska sidan omdirigeras?',
    'If no category is selected the Main Category is used' => 'Om ingen kategori väljs, används huvudkategorin',
    'Upload a brand logo from your computer.' => 'Ladda upp logotyp från din dator.',
    'If you want to quickly create a new category, you can do it here. Don’t forget to then go to the Categories page to fill in the needed details (description, image, etc.). A new category will not automatically appear in your shop\'s menu, please read the Help about it.' => 'Om du snabbt vill skapa en ny kategori, kan du göra det här. Glöm inte att sen gå till Kategorier-sidan för att fylla i detaljer (beskrivning, bild etc.). En ny kategori kommer inte att automatisk visas i butikens meny, läs mer under Hjälp.',
    'This interface allows you to specify the suppliers of the current combination.' => 'Detta gränssnitt låter dig specificera leverantörer av nuvarande kombination.',
    'Using another image as cover will automatically uncheck this box.' => 'Om du använder en annan bild som omslagsbild, så kommer den här kryssrutan att inaktiveras.',
    'This is the net sales price for your customers. The retail price (tax incl.) will automatically be calculated using the selected tax rate.' => 'Det här är priset som kund betalar. Priset räknas ut automatiskt med hjälp av vald momsklass.',
    'Indicate the price for a single unit of the product. For instance, if you\'re selling fabrics, it would be the price per meter.' => 'Priset för en enhet av produkten. Om du exempelvis säljer tyg, så är det priset per meter.',
    'This description will appear in search engines. It should be a single sentence, shorter than 160 characters (including spaces).' => 'Den här beskrivningen kommer att synas i sökmotorer. Ange en mening, kortare än 160 tecken (inklusive mellanslag).',
    'Public title for the product page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the right of the field.' => 'Titel för produktsidan och för sökmotorer. Lämna fältet tomt för att använda produktnamnet. Antal återstående tecken visas till höger om fältet.',
    'Will appear in the list of suppliers.' => 'Kommer att visas i listan över leverantörer.',
    'Upload a supplier logo from your computer.' => 'Ladda upp leverantören logotyp från din dator.',
    'Only letters and the minus (-) character are allowed.' => 'Endast bokstäver och minus (-) tecken är tillåtna',
    'Search name' => 'Sök namn',
    'Search ref.' => 'Sökref.',
    'Search category' => 'Sök en kategori',
    'Permanently delete this product.' => 'Ta bort denna produkt permanent.',
    'See how your product sheet will look online: ALT+SHIFT+V' => 'Se hur din produktsida kommer att se ut: ALT+SHIFT+V',
    'Enable or disable the product on your shop: ALT+SHIFT+O' => 'Aktivera eller inaktivera produkten i din butik: ALT+SHIFT+O',
    'Save the product and stay on the current page: ALT+SHIFT+S' => 'Spara produkten och stanna på nuvarande sida: ALT+SHIFT+S',
    'Save and duplicate this product, then go to the new product: ALT+SHIFT+D' => 'Spara och duplicera den här produkten, gå sedan till den nya produkten: ALT+SHIFT+D',
    'Save and go back to the catalog: ALT+SHIFT+Q' => 'Spara och återvänd till katalogen: ALT+SHIFT+Q',
    'Save and create a new product: ALT+SHIFT+P' => 'Spara och skapa en ny produkt: ALT+SHIFT+P',
    'Is the product a pack (a combination of at least two existing products), a virtual product (downloadable file, service, etc.), or simply a standard, physical product?' => 'Är produkten ett paket (en kombination av minst två befintliga produkter), en virtuell produkt (nerladdningsbar fil, tjänst etc.), eller en standard fysisk produkt?',
    'Where should the product be available on your site? The main category is where the product appears by default: this is the category which is seen in the product page\'s URL. Disabled categories are written in italics.' => 'Var ska produkten visas på din sajt? Huvudkategorin är den förvalda: det är den kategori som visas på produktsidans URL. Inaktiverade kategorier visas i kursiv text.',
    'Search categories' => 'Sök kategorier',
    'If you want to quickly create a new category, you can do it here. Don’t forget to then go to the Categories page to fill in the needed details (description, image, etc.).  A new category will not automatically appear in your shop\'s menu, please read the Help about it.' => 'Om du snabbt vill skapa en ny kategori, kan du göra det här. Glöm inte att sen gå till Kategorier-sidan för att fylla i detaljer (beskrivning, bild etc.). En ny kategori kommer inte att automatisk visas i butikens meny, läs mer under Hjälp.',
    'Does this combination have a different price? Is it cheaper or more expensive than the default retail price?' => 'Har denna kombination ett annat pris? Är den billigare eller dyrare än det förvalda försäljningspriset?',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. To create a combination, you need to create your product attributes first. Go to Catalog > Attributes & Features for this!' => 'Kombinationer är olika varianter av en produkt, med attribut som storlek, vikt eller färg som har olika värden. För att skapa en kombination, så måste du skapa produktattribut först. Gå till Katalog > Attribut & Funktioner för att göra detta!',
    'To add combinations, you first need to create proper attributes and values in [1]Attributes & Features[/1]. <br> When done, you may enter the wanted attributes (like "size" or "color") and their respective values ("XS", "red", "all", etc.) in the field below; or simply select them from the right column. Then click on "Generate": it will automatically create all the combinations for you!' => 'För att använda kombinationer måste du först skapa attribut och värden i [1]Attribut och funktioner[/1]. <br> När det är klart så kan du välja attribut (som "storlek" eller "färg") och deras respektive värden ("XS", "röd", "alla" etc.) i fältet nedan; eller så kan du välja i högerkolumnen. Klicka sedan på "Generera": då kommer alla kombinationer att skapas automatiskt!',
    'To add combinations, you first need to create proper attributes and values in [1]%attributes_and_features_label%[/1]. <br> When done, you may enter the wanted attributes (like "size" or "color") and their respective values ("XS", "red", "all", etc.) in the field below; or simply select them from the right column. Then click on "%generate_label%": it will automatically create all the combinations for you!' => 'För att lägga till kombinationer måste du först skapa attribut och värden i [1]%attributes_and_features_label%[/1]. <br> När det är klart så kan du välja attribut (som "storlek" eller "färg") och deras respektive värden ("XS", "röd", "alla" etc.) i fältet nedan; eller så kan du välja i högerkolumnen. Klicka sedan på "%generate_label%": då kommer alla kombinationer att skapas automatiskt!',
    'This is the human-readable URL, as generated from the product\'s name. You can change it if you want.' => 'Det här är en SEO-vänlig URL, genererad från produktnamnet. Du kan ändra den om du vill.',
    'When your product is disabled, choose to which page you’d like to redirect the customers visiting its page by typing the product or category name.' => 'När din produkt är inaktiv, ange vilken sida som du vill skicka dina besökare vidare till, genom att ange produkt- eller kategorinamn.',
    'No redirection (404) = Do not redirect anywhere and display a 404 "Not Found" page.' => 'Ingen omdirigering (404) = Omdirigera inte, visa i stället en 404 "Sidan kunde inte hittas".',
    'Permanent redirection (301) = Permanently display another product or category instead.' => 'Permanent omdirigering (301) = Visar permanent en annan produkt eller kategori i stället.',
    'Temporary redirection (302) = Temporarily display another product or category instead.' => 'Tillfällig omdirigering (302) = Visar tillfälligt en annan produkt eller kategori i stället.',
    'Display delivery time for a product is advised for merchants selling in Europe to comply with the local laws.' => 'Visa leverans tid för en produkt rekommenderas för E-handlare som säljer i Europa för att dölja de lokala lagarna.',
    'edit' => 'redigera',
    'If a carrier has a tax, it will be added to the shipping fees. Does not apply to free shipping.' => 'Om moms är inställt på speditören, så kommer den att läggas till på frakten. Gäller inte för fri frakt.',
    'This interface allows you to specify the suppliers of the current product and its combinations, if any.' => 'Detta gränssnitt låter dig specificera leverantörer av den valda produkten samt eventuella kombinationer.',
    'You can specify supplier references according to previously associated suppliers.' => 'Du kan ange leverantörs referensnummer för kopplade leverantörer.',
    'When using the advanced stock management tool (see Shop Parameters > Products settings), the values you define (price, references) will be used in supply orders.' => 'När du använder den avancerade lagerhanteringen (se under Inställningar > Produkter), kommer värdena du fyller i här (priser, referenser) att användas i leverantörbeställningarna.',
    'You can specify product reference(s) for each associated supplier. Click "Save" after changing selected suppliers to display the associated product references.' => 'Du kan specificera produktreferens(er) för varje kopplad leverantör. Klicka på "Spara" efter att ha ändrat valda leverantörer för att visa kopplade produktreferenser.',
    'You can specify product reference(s) for each associated supplier. Click "%save_label%" after changing selected suppliers to display the associated product references.' => 'Du kan specificera produktreferens(er) för varje kopplad leverantör. Klicka på  "%save_label%" efter att ha ändrat valda leverantörer för att visa kopplade produktreferenser.',
    'This interface allows you to specify the warehouse in which the product is stocked.' => 'Detta gränssnitt låter dig specificera i vilka varulager produkten skall lagras.',
    'It is also possible to specify the location within the warehouse for each product or combination.' => 'Det är också möjligt att ange lagerplatsen för varje produkt eller kombination.',
    'Number of days this file can be accessed by customers. Set to zero for unlimited access.' => 'Antal dagar som den här filen kan kommas åt av kunder. Sätt till 0 för obegränsad åtkomst.',
    'Upload a file from your computer (%maxUploadSize% max.)' => 'Ladda upp en fil från din dator (max %maxUploadSize%)',
    'The full filename with its extension (e.g. Book.pdf)' => 'Det fullständiga filnamnet med dess förlängning (t ex Book.pdf)',
    'Number of downloads allowed per customer. Set to 0 for unlimited downloads.' => 'Antal tillåtna nedladdninger per kund. (0 = obegränsat).',
    'If set, the file will not be downloadable after this date. Leave blank if you do not wish to attach an expiration date.' => 'Om angivet, så kan inte filen laddas ned efter detta datum. Lämna tom för att inte ange något bästföredatum.',
    'The minimum quantity required to buy this product (set to 1 to disable this feature). E.g.: if set to 3, customers will be able to purchase the product only if they take at least 3 in quantity.' => 'Minsta kvantitet för att köpa den här produkten (sätt till 1 för att stänga av funktionen). Ex. om satt till 3, så måste kund köpa minst 3 av produkten.',
    'The email will be sent to all the users who have the right to run the stock page. To modify the permissions, go to [1]Advanced Parameters > Team[/1]' => 'Detta mail kommer att skickas till alla användare som har rätt att använda lager sidan. För att ändra behörigheterna, gå till [1]Avancerade inställningar > Anställda[/1]',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. Does your product require combinations?' => 'Kombinationer är olika varianter av en produkt, med attribut som storlek, vikt eller färg som har olika värden. Behöver din produkt kombinationer?',
    'Advanced settings in [1][2]Combinations[/1]' => 'Avancerade inställningar i [1][2]Kombinationer[/1]',
    'Your reference code for this product. Allowed special characters: .-_#.' => 'Din referenskod för denna produkt. Tillåtna specialtecken: .-_#.',
    'How many products should be available for sale?' => 'Hur många produkter finns för försäljning?',
    'Advanced settings in [1][2]Quantities[/1]' => 'Avancerade inställningar i [1][2]Kvantiteter[/1]',
    'This is the retail price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Det här är försäljningspriset som visas för dina kunder. Priset inkl. moms ändras beroende på valda momsregler.',
    'Advanced settings in [1][2]Pricing[/1]' => 'Avancerade inställningar i [1][2]Priser[/1]',
    'Tags are meant to help your customers find your products via the search bar.' => 'Etiketter kan användas för att dina kunder ska hitta produkterna vid en sökning.',
    'Choose terms and keywords that your customers will use to search for this product and make sure you are consistent with the tags you may have already used.' => 'Använd fraser och nyckelord som dina kunder använder sig av för att söka efter produkten. Var noga med att vara konsekvent med de etiketter du eventuellt redan använt.',
    'You can manage tag aliases in the [1]Search section[/1]. If you add new tags, you have to rebuild the index.' => 'Du kan hantera etikett-alias under sektionen [1]Sök[/1]. Om du lägger till nya etiketter, så måste du bygga om index.',
    'Not all shops sell new products. This option enables you to indicate the condition of the product. It can be required on some marketplaces.' => 'Inte alla butiker säljer nya produkter. Den här inställningen visar skicket på produkten. Det kan vara obligatoriskt på vissa marknadsplatser.',
    'ISBN is used internationally to identify books and their various editions.' => 'ISBN används internationellt för att identifiera böcker och olika utgåvor.',
    'This type of product code is widely used in the United States, Canada, the United Kingdom, Australia, New Zealand and in other countries.' => 'Den här typen av produktkod används flitigt i bl.a. USA, Kanada, Storbritannien, Australien och Nya Zeeland.',
    'This type of product code is specific to Europe and Japan, but is widely used internationally. It is a superset of the UPC code: all products marked with an EAN will be accepted in North America.' => 'Den här typen av produktkod används framför allt i Europa och Japan, men även internationellt. Det är huvudklassen för UPC: alla produkter med EAN kommer att godkännas i USA.',
    'MPN is used internationally to identify the Manufacturer Part Number.' => 'MPN används intern för att identifiera tillverkaren artikelnummer.',
    'This is the price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Det här är försäljningspriset som visas för dina kunder. Priset inkl. moms ändras beroende på valda momsregler.',
    'Some products can be purchased by unit (per bottle, per pound, etc.),  and this is the price for one unit. For instance, if you’re selling fabrics, it would be the price per meter.' => 'Vissa produkter kan köpas per enhet (per kg, flaska etc.), och detta är priset för en enhet. Om du exempelvis säljer tyg, så kan det vara pris per meter.',
    'The cost price is the price you paid for the product. Do not include the tax. It should be lower than the retail price: the difference between the two will be your margin.' => 'Inköpspriset är det pris du köpt in vara för. Ange pris exkl. moms. Det bör vara lägre än försäljningspriset; mellanskillnaden blir din marginal.',
    'You can set specific prices for customers belonging to different groups, different countries, etc.' => 'Du kan ange specifika priser för kunder som tillhör olika grupper, länder, etc.',
    'Sometimes one customer can fit into multiple price rules. Priorities allow you to define which rules apply first.' => 'Ibland kan en kund uppfylla flera specifika prisregler. Prioriteter tillåter dig att definiera vilken regel som skall först ska gälla för en kund.',
    'Invalid token' => 'Ogiltig nyckel',
    '[1]Invalid token[/1]: direct access to this link may lead to a potential security breach.' => '[1]Ogiltig token[/1]: direktklick på denna länk kan leda till säkerhetsproblem.',
    'Do you want to display this page?' => 'Vill du visa denna sida?',
    'Yes, I understand the risks' => 'Ja, jag förstår riskerna',
    'Take me out of there!' => 'Ta mig härifrån!',
    'Click on "Displayed" to index the category on your shop.' => 'Klicka på "Visas" för att indexera kategorin i din butik.',
    'This is the main image for your category, displayed in the category page. The category description will overlap this image and appear in its top-left corner.' => 'Det här är huvudbilden för kategori, som visas på kategorisidan. Kategoribeskrivningen kommer att överlappa bilden och visas i övre vänster hörn.',
    'Displays a small image in the parent category\'s page, if the theme allows it.' => 'Visar en liten bild på sidan för föräldrakategorin, om temat tillåter det.',
    'The category thumbnail appears in the menu as a small image representing the category, if the theme allows it.' => 'Kategoriminiatyrer visas i menyn som en liten bild som representerar kategorin, om temat tillåter det.',
    'Only letters, numbers, underscore (_) and the minus (-) character are allowed.' => 'Endast bokstäver, siffror, understreck (_) och minus (-) tecken är tillåtna.',
    'You now have three default customer groups.' => 'Du har nu tre standardgrupper för kunder.',
    'Mark all of the customer groups which you would like to have access to this category.' => 'Markera alla kundgrupper som ska ha tillgång till den här kategorin.',
    'If you want a category to appear in the menu of your shop, go to [1]Modules > Module Manager[/1] and configure your menu module.' => 'Om du vill att en kategori ska visas i butikens meny, gå till [1]Moduler > Moduler & Tjänster > Installerade moduler.[/1] Konfigurera sen menymodulen.',
    'Click on "%displayed_label%" to index the category on your shop.' => 'Klicka på  "%displayed_label%" för att indexera kategorin i din butik.',
    'To add "tags", click inside the field, write something, and then press "Enter".' => 'För att lägga till "taggar", klicka i fältet och skriv något, tryck sedan på "Enter".',
    'An empty category is a category that has no product directly associated to it. An empty category may however contain products through its subcategories.' => 'En tom kategori är en kategori som inte innehåller några produkter. En tom kategori kan emellertid innehålla produkter i dess underkategorier.',
    'To add combinations, you first need to create proper attributes and values in [1]%attributes_and_features_label%[/1].' => 'För att lägga till kombinationer, så måste du först skapa passande attribut och värden under [1]%attributes_and_features_label%[/1].',
    'To specify the suppliers of this product\'s combinations you can go to [1]{combinations_label}[/1] tab.' => 'För att ange leverantörer för produktens kombinationer, så kan du göra det under fliken [1]{combinations_label}[/1] .',
  ),
