    'Your online store needs to have a proper carrier registered in PrestaShop as soon as you start shipping your products. This means sending yours parcels using your local postal service, or having a contract with a private carrier which in turn will ship your parcels to your customers. In order to have PrestaShop suggest the most adequate carrier to your customers during their order checkout process, you need to register all the carriers with which you have chosen to work.' => 'Din butik behöver en distributör så snart du ska börja att skicka dina produkter. Antingen använder du ditt lokala postkontor eller så kan du ha ett avtal med ett fraktföretag som i sin tur skickar dina produkter till dina kunder. För att PrestaShop ska kunna rekommendera kunden den bästa distributören i kassan, så måste du registrera alla fraktalternativ i butiken.',
