    'There is a huge quantity of data, so each connection corresponding to a referrer is indexed. You can also refresh this index by clicking the "Refresh index" button. This process may take a while, and it\'s only needed if you modified or added a referrer, or if you want changes to be retroactive.' => 'Det finns en väldigt stor mängd data, så varje anslutning som matchar en referens indexderas. Du kan ladda om detta index genom att klicka på knappen ovan. Var medveten om att det kan ta väldigt lång tid och endast behövs om du ändrat eller lagt till en referens och vill att dina ändringar ska vara retroaktiva.',
    'Your data is cached in order to sort it and filter it. You can refresh the cache by clicking on the "Refresh cache" button.' => 'Din data cachas för sortering och filtrering. Du kan uppdatera cache genom att klicka på knappen "Uppdatera cache".',
    'Direct traffic can be quite resource-intensive. You should consider enabling it only if you have a strong need for it.' => 'Direkt trafik kan vara ganska tidskrävande. Du bör överväga att göra det möjligt endast om du har en stark databasserver och ett starkt behov av det.',
    'Show me more' => 'Visa mer',
    'Definitions:' => 'Definitioner:',
    'The "http_referer" field is the website from which your customers arrive.' => 'Fältet "http_referer" är sajten som din besökare kommer från.',
    'For example, visitors coming from Google will have an "http_referer" value like this one: "http://www.google.com/search?q=prestashop".' => 'Till exempel, besökare som kommer från Google har en "http_referer" som den här:" http://www.google.com/search?q=prestashop ".',
    'If the visitor arrives directly (by typing the URL of your shop, or by using their bookmarks, for example), the http_referer will be empty.' => 'Om besökaren kommer direkt (genom att skriva in adressen till din butik eller genom att använda sina bokmärken, till exempel), så kommer http_referer att vara tom.',
    'If you\'d like to view all the visitors coming from Google, you can type "%google%" in this field. Alternatively, you can type "%google.fr%" if you want to view visitors coming from Google France, only.' => 'Så om du vill att alla besökare som kommer från Google kan du skriva \\"% google%\\" på detta område, eller \\"% google.fr%\\" om du vill att besökare som kommer från Google Frankrike bara.',
    'The "request_uri" field is the URL from which the customers come to your website.' => 'Fältet "request_uri" är den URL som besökaren kommer via.',
    'For example, if the visitor accesses a product page, the URL will be like this one: "%smusic-ipods/1-ipod-nano.html".' => 'Till exempel, om besökare kommer från en produktsida, så kommer URL att vara som den här: "%smusic-ipods/1-ipod-nano-html".',
    'This is helpful because you can add tags or tokens in the links pointing to your website.' => 'Detta är hjälpfullt eftersom du kan lägga till taggar eller tokens i länkarna som pekar mot din webbsida.',
    'For example, you can post a link (such as "%sindex.php?myuniquekeyword" -- note that you added "?myuniquekeyword" at the end of the URL) in an online forum or as a blog comment, and get visitors statistics for that unique link by entering "%%myuniquekeyword" in the "request_uri" field.' => 'Till exempel, du kan posta en länk (som "%sindex.php?myuniquekeyword" -- notera att du lade till "?myuniquekeyword" i slutet av URL) på ett forum eller som en bloggkommentar, och få besökarstatistik för den unika länken genom att ange "%%myuniquekeyword" i fältet "request_uri".',
    'This method is more reliable than the "http_referer" one, but there is one disadvantage: if a search engine references a page with your link, then it will be displayed in the search results and you will not only indicate visitors from the places where you posted the link, but also those from the search engines that picked up that link.' => 'Den här metoden är mer tillförlitlig än "http_referer", men det finns en nackdel: om en sökmotor refererar till en sida med din länk, då kommer den att visas i sökresultat och du kommer att få besökare inte bara från stället där du postade länken, utan även via sökmotorer som refererar till sidan.',
    'The "Include" fields indicate what has to be included in the URL.' => 'Fälten "inkluderar" anger vad som ska ingå i webbadressen.',
    'The "Exclude" fields indicate what has to be excluded from the URL.' => 'Fälten "utesluta" anger vad som bör undantas från URL.',
    'When using simple mode, you can use a wide variety of generic characters to replace other characters:' => 'När du använder den enkla läget kan du använda vissa allmänna tecken som kan ersätta andra tecken:',
    '"_" will replace one character. If you want to use the real "_", you should type this: "\\\\_".' => '"_" kommer att ersätta ett tecken. Om du vill använda tecknet "_", skriv så här: "\\\\_".',
    '"%" will replace any number of characters. If you want to use the real "%", you should type this: "\\\\%".' => '"%" kommer att ersätta valfritt antal tecken. Om du vill använda tecknet "%", skriv så här: "\\\\%".',
    'The Simple mode uses the MySQL "LIKE" pattern matching, but for a higher potency you can use MySQL\'s regular expressions in the Expert mode.' => 'Simple mode använder mönstermatchning "LIKE", men för ett bättre resultat så kan du använda MySQL\'s reguljära uttryck i Export mode.',
    'Take a look at MySQL\'s documentation for more details.' => 'Ta en titt i MySQL\'s dokumentation för mer detaljer.',
    'Get help!' => 'Få hjälp!',
    'e.g. 10:00AM - 9:30PM' => 'Exempel: från 10:00 till 21:30',
    'Further information regarding this contact.' => 'Ytterligare information om denna kontakt.',
    'Image width in pixels. Enter "0" to use the original size.' => 'Bildens bredd i pixlar. Ange "0" för orginalstorlek',
    'Image height in pixels. Enter "0" to use the original size.' => 'Bildens höjd i pixlar. Ange "0" för orginalstorlek',
    'The group defined for your un-identified visitors.' => 'Gruppen för de odefinierad besökarna.',
    'The group defined for your identified guest customers (used in guest checkout).' => 'Definierad grupp för identifierade gästkunder (används i gäst-checkout).',
    'The group defined for your identified registered customers.' => 'Grupptillhörighet för dina registrerade kunder.',
    'Automatically apply this value as a discount on all products for members of this customer group.' => 'Automatiskt gäller detta värde som en rabatt på alla butikens produkter för denna grupps medlemmar.',
    'How prices are displayed in the order summary for this customer group.' => 'Hur priserna visas på Beställ sammandrag för denna kundgrupp (skatt inkluderade eller exkluderade).',
    'Customers in this group can view prices.' => 'Kunderna i denna grupp kan se pris.',
    '%group_name% - All persons without a customer account or customers that are not logged in.' => '%group_name% - Alla personer utan ett kundkonto eller kunder som inte är inloggade.',
    '%group_name% - All persons who placed an order through Guest Checkout.' => '%group_name% - Alla personer som gjort beställningar via Gästkonto.',
    '%group_name% - All persons who created an account on this site.' => '%group_name% - Alla personer som skapat ett konto på denna webbplats.',
    'PrestaShop has three default customer groups:' => 'PrestaShop har tre förvalda kundgrupper:',
    'Need to hide prices for all groups? Save time, enable catalog mode in Product Settings instead.' => 'Ska priset döljas för alla grupper? Spara tid genom att aktivera katalog-läge under Produktinställningar istället.',
    'Leave blank if no change.' => 'Lämna tomt vid noll kostnad.',
    'Fee given for each visit.' => 'Avgift som anges för varje besök.',
    'Fee given for each order placed.' => 'Avgift anges för varje beställning.',
    'If you know how to use MySQL regular expressions, you can use the [1]expert mode[/1].' => 'Om du vet hur man använder MySQL reguljära uttryck, kan du använda [1]expertläget[/1].',
    'Enable the automatic indexing of products. If you enable this feature, the products will be indexed in the search automatically when they are saved. If the feature is disabled, you will have to index products manually by using the links provided in the field set.' => 'Aktivera automatisk indexering av produkter. Om du aktiverar denna funktion kommer produkter att indexeras i sök-indexet automatiskt när de skapas i butiken. Om du inte har denna funktion aktiverad, måste du manuellt indexera produkterna via länkarna nedan.',
    'By default, to search for “blouse”, you have to enter “blous”, “blo”, etc (beginning of the word) – but not “lous” (within the word).' => 'Förinställt, för att söka efter "blus", måste du skriva "blus", "blu", etc. (början av ordet) - men inte "lus" (inom ordet).',
    'With this option enabled, it also gives the good result if you search for “lous”, “ouse”, or anything contained in the word.' => 'Om du aktiverar den här funktionen, får du även träff på "lus", "us" eller annat som finns i ordet.',
    'Enable search within a whole word, rather than from its beginning only.' => 'Aktivera sökningen inom ordet, inte bara början på ordet.',
    'It checks if the searched term is contained in the indexed word. This may be resource-consuming.' => 'Kontrollerar om söktermen finns i det indexerade ordet. Detta kan vara resurskrävande.',
    'By default, if you search "book", you will have "book", "bookcase" and "bookend".' => 'Om du söker "bok", så kommer "bok", "bokhylla" och "boklåda" också att hittas.',
    'With this option enabled, it only gives one result “book”, as exact end of the indexed word is matching.' => 'Om du aktiverar det här valet, så kommer bara resultatet "bok" att hittas.',
    'Enable more precise search with the end of the word.' => 'Aktivera en mer precis matchning med rätt ändelse.',
    'It checks if the searched term is the exact end of the indexed word.' => 'Det kontrollerar om söktermen har samma ändelse som det indexerade ordet.',
    'Only words this size or larger will be indexed.' => 'Bara ord från den här storleken kommer att indexeras.',
    'Please enter the index words separated by a "|".' => 'Skriv in de ord separerade med ett "|".',
    'Enter each alias separated by a comma (e.g. \'prestshop,preztashop,prestasohp\').' => 'Ange varje alias separerad med ett kommatecken (t.ex. \'prestshop,preztashop,prestasohp\').',
    'Forbidden characters: <>;=#{}' => 'Förbjudna tecken: <>;=#{}',
    'Search this word instead.' => 'Sök detta ordet istället.',
    'By default, the fuzzy search is enabled. It means spelling errors are allowed, e.g. you can search for "bird" with words like "burd", "bard" or "beerd".' => 'Förvalt är att alternativstavningssökning är aktiv. Det betyder att stavfel är okej, exempelvis kan du söka efter "fågel", med ord som "fagel", "fögel" eller "fegel".',
    'Enable approximate string matching.' => 'Aktivera ungefärlig strängmatchning.',
    'Note that this option is resource-consuming: the more you search, the longer it takes.' => 'Notera att inställningen är resurskrävande: ju mer du söker, ju längre tid tar det.',
    'Disabling this option will require exact spelling for the search to match results.' => 'Om du stänger av funktionen, så måste sökningen vara rättstavad för att matcha ett resultat.',
    'Only words fewer or equal to this maximum length will be searched.' => 'Endast ord som har färre eller maximal textlängd kommer att sökas.',
    'This parameter will only be used if the fuzzy search is activated: the lower the value, the more tolerant your search will be.' => 'Parametern kommer bara att användas om alternativstavningssökning är aktiverad, ju lägre värde, ju mer tolerant kommer sökningen att bli.',
    'This field does not refer to the shop name visible in the front office.' => 'Detta fält är inte butikens synliga namn för kunderna.',
    'Follow [1]this link[/1] to edit the shop name used on the front office.' => 'Klicka på [1]denna länk[/1] för att ändra butiksnamnet som visas för kund.',
    'You can\'t edit the shop group because the current shop belongs to a group with the "share" option enabled.' => 'Du kan inte redigera butiken eftersom den tillhör en grupp som har \\"dela\\" inställningen aktiverad.',
    'This is the root category of the store that you\'ve created. To define a new root category for your store, [1]please click here[/1].' => 'Det här är rotkategorin i butiken du skapat. För att definiera en ny rotkategori, [1]klicka här[/1].',
    'By selecting associated categories, you are choosing to share the categories between shops. Once associated between shops, any alteration of this category will impact every shop.' => 'Genom att välja associerade kategorier, väljer du att dela kategorierna mellan olika butiker. När de är delade, så påverkas samtliga butiker av förändringar på kategorierna.',
    'Upload an icon from your computer (File type: .gif, suggested size: 16x16).' => 'Ladda upp en ikon från din dator (Filtyp:. Gif storlek: 16x16).',
    'Whether or not to display this store.' => 'Visa/visa inte den här butiken.',
    'Storefront picture.' => 'Bild på butiken.',
    'Displayed in emails sent to customers.' => 'Visas i e-post som skickas till kunderna.',
    'Shop registration information (e.g. SIRET or RCS).' => 'Butikens registreringsinformation (t.ex. organisationsnummer).',
    'Contact name (e.g. Customer Support).' => 'Kontaktnamn, t.ex. teknisk support.',
    'Emails will be sent to this address.' => 'E-post kommer att skickas till denna adress.',
    'If enabled, all messages will be saved in the "Customer Service" page under the "Customer" menu.' => 'Om aktiverad, så kommer alla meddelanden sparas i Kundservice under Kunder',
    'After a customer logs in, you can recall and display the content of his/her last shopping cart.' => 'Efter att kunden har loggat in, kan du återskapa och visa innehållet i hens senaste varukorg.',
    'Minimum time required between two requests for a password reset.' => 'Minsta tid mellan två försök till återställning av lösenord.',
    'Activate or deactivate B2B mode. When this option is enabled, B2B features will be made available.' => 'Aktivera eller inaktivera B2B-läge. När detta alternativ är aktiverat, är vissa B2B-funktioner tillgängliga.',
    'Display or not the birth date field.' => 'Visa fältet födelsedag eller inte.',
    'Display or not the partner offers tick box, to receive offers from the store\'s partners.' => 'Visa kryssruta för att få erbjudande av butikens partner.',
    'Send an email with a summary of the account information after registration.' => 'Skicka ett mail med en sammanfattning av kontoinformation efter registreringen.',
    'We recommend that you deactivate your store while performing maintenance. Note that it will not disable the webservice.' => 'Vi rekommenderar att du inaktiverar din shop innan du utför underhåll. Notera att detta inte inaktiverar webservice.',
    'Allow IP addresses to access the store, even in maintenance mode. Use a comma to separate them (e.g. 42.24.4.2,127.0.0.1,99.98.97.96).' => 'Tillåt IP-adresser att komma åt shopen även i underhållsläge. Använd kommatecken för att separera dem (ex. 42.24.4.2,127.0.0.1,99.98.97.96).',
    'Display a customized message when the store is disabled.' => 'Visa ett anpassat meddelande när shopen är inaktiv.',
    'If you own an SSL certificate for your shop\'s domain name, you can activate SSL encryption (https://) for customer account identification and order processing.' => 'Om du äger ett SSL certifikat för din butiks domännamn, kan du aktivera SSL kryptering (https: //) för kunddata och orderhantering.',
    'When enabled, all the pages of your shop will be SSL-secured.' => 'När funktionen är aktiverad, kommer alla sidor i din butik att vara SSL-säkrade.',
    'Enable or disable token in the Front Office to improve PrestaShop\'s security.' => 'Aktivera eller inaktivera token på Front Office för att förbättra säkerheten i PrestaShop.',
    'Allow iframes on text fields like product description. We recommend that you leave this option disabled.' => 'Tillåt iframes i fält som t.ex. produktbeskrivning. Vi rekommenderar att du lämnar detta val inaktiverat.',
    'Clean the HTML content on text fields. We recommend that you leave this option enabled.' => 'Filtrera bort HTML-kod i textfält. Vi rekommenderar att det här valet är aktiverat.',
    'You can choose among 6 different ways of rounding prices. "Round up away from zero ..." is the recommended behavior.' => 'Du kan välja mellan 6 olika sätt att avrunda priser. "Avrunda upp från noll..." är rekommenderat.',
    'You can choose when to round prices: either on each item, each line or the total (of an invoice, for example).' => 'Du kan välja när du vill avrunda priser: antingen på varje artikel, varje rad eller på totalen (på ex. en faktura).',
    'Enable best sellers page on your front office even when its respective module is disabled.' => 'Aktivera sida för bästsäljare i butiken även om respektive modul är inaktiverad.',
    'The multistore feature allows you to manage several e-shops with one Back Office. If this feature is enabled, a "Multistore" page will be available in the "Advanced Parameters" menu.' => 'Multishoplösningen låter dig hantera flera butiker från samma administrationsgränssnitt. Om denna funktion är aktiverad kommer en Multishop-meny att synas under menyn Avancerade inställningar.',
    'Enable suppliers page on your front office even when its module is disabled.' => 'Aktivera leverantör-sidor i butiken även när deras respektive moduler är inaktiverade.',
    'Enable brands page on your front office even when its module is disabled.' => 'Aktivera sida för varumärken i butiken även om respektive modul är inaktiverad.',
    'Display an overview of the addresses, shipping method and cart just before the order button (required in some European countries).' => 'Visa en översikt över adresser, fraktmetoder och varukorg strax innan orderknappen (krav i vissa europeiska länder).',
    'Allow guest visitors to place an order without registering.' => 'Låt gäster handla utan att registrera ett konto.',
    'Disable the option to allow customers to reorder in one click from the order history page (required in some European countries).' => 'Inaktivera möjligheten för kund att ombeställa en tidigare order från orderhistoriken (obligatorisk i vissa europeiska länder).',
    'Set to 0 to disable this feature.' => 'Sätt till 0 för att inaktivera den här funktionen.',
    'Automatically updates the shipping costs when you edit an order.' => 'Automatisk uppdatering av fraktkostnader när du redigerar en beställning.',
    'Require customers to accept or decline terms of service before processing an order.' => 'Kräv kunderna att acceptera eller avböja villkoren i tjänst innan behandlingen av ordning',
    'Choose the page which contains your store\'s terms and conditions of use.' => 'Välj sidan som innehåller din butiks villkor och användningsvillkor.',
    'Allow the customer to ship orders to multiple addresses. This option will convert the customer\'s cart into one or more orders.' => 'Tillåt kunden att få beställningen levererad till olika adresser. Detta val omvandlar kundens kundvagn till en eller flera beställningar.',
    'It allows you to delay shipping if your customers request it.' => 'Låter dig fördröja leveransen om kunden så önskar .',
    'Suggest gift-wrapping to customers.' => 'Föreslå present-förpackning till kunden och möjligheten att lämna ett meddelande',
    'Set a price for gift wrapping.' => 'Sätt ett pris för presentförpackning.',
    'Set a tax for gift wrapping.' => 'Välj moms för presentförpackning.',
    'Suggest recycled packaging to customer.' => 'Föreslå återvunna förpackningar till kund.',
    'Only letters, numbers and underscores ("_") are allowed.' => 'Endast bokstäver, siffror och understreck ("_") är tillåtna.',
    'Email template for both .html and .txt.' => 'E-post mall för båda. Html och. Txt.',
    'characters' => 'tecken',
    'Note that the label will be displayed only if backorders are denied.' => 'Notera att etiketten bara visas om  restorder inte är tillåten.',
    'Enable this option if you want to display your product\'s attributes in its meta title.' => 'Aktivera detta val om du vill visa produkters attribut i meta-titeln.',
    'Enable this option only if your server allows URL rewriting (recommended).' => 'Aktivera den här inställningen om din server har URL rewriting (rekommenderad).',
    'URL rewriting (mod_rewrite) is not active on your server, or it is not possible to check your server configuration. If you want to use Friendly URLs, you must activate this mod.' => 'URL-omskrivning (mod_rewrite) är inte aktiverat på din server eller så kan din serverkonfiguration inte kontrolleras. Om du vill använda SEO-vänliga URLer, måste denna funktion vara aktiverad.',
    'Enable this option only if you have problems with URL rewriting.' => 'Aktivera detta val endast om du har problem med vissa sidors URL omskrivning.',
    'Some of PrestaShop\'s features might not work correctly with a specific configuration of Apache\'s mod_security module. We recommend to turn it off.' => 'Vissa av funktionerna i PrestaShop kanske inte fungerar med en specifik konfiguration av Apache-modulen mod_security. Vi rekommenderar att stänga av funktionen.',
    'Enable this option if you want to allow accented characters in your friendly URLs. You should only activate this option if you are using non-Latin characters; for all the Latin charsets, your SEO will be better without this option.' => 'Aktivera detta val om du vill tillåta accentuerad tecken i shopens URL:er. Du bör bara aktivera valet om du använder icke-latinska tecken. För alla latinska teckenuppsättningar, så kommer SEO att fungera bättre utan detta val aktiverat.',
    'The catalog mode is actually to disable products checkout (prices, add to cart, etc.) on your shop, like a retail website does.' => 'Katalogläge används för att inaktivera försäljning (visa priser, lägg i varukorg etc.) i din butik.',
    'Set the maximum size of the summary of your product description (in characters).' => 'Ställ in den maximala storleken på sammanfattningen av produktbeskrivningen (i tecken).',
    'How to calculate quantity discounts.' => 'Hur mängdrabatt ska räknas ut.',
    'When active, friendly URL will be updated on every save.' => 'Om aktiv, så kommer SEO-vänliga URLer att uppdateras vid varje spartillfälle.',
    'When active, new products will be activated by default during creation.' => 'Om aktiv, så kommer nya produkter att aktiveras som standard när de skapas.',
    'Catalog mode disables the shopping cart on your store. Visitors will be able to browse your products catalog, but not buy them.' => 'Katalog-läge inaktiverar varukorgen i din butik. Besökare kan titta på produkterna, men kan inte köpa dem.',
    'Have specific needs? Edit particular groups to let them see prices or not.' => 'Finns särskilda behov? Redigera grupperna för att visa priser eller ej.',
    'Display product prices when in catalog mode.' => 'Visa produkternas priser när du är i katalog-läge.',
    'Set to "0" to disable this feature.' => 'Sätt till 0 för att inaktivera den här funktionen',
    'Display or hide the "add to cart" button on category pages for products that have attributes forcing customers to see product details.' => 'Visa eller dölja "lägg i varukorg"-knappen på kategorin sidor för produkter som har egenskaper för att tvinga kunderna att se produkten detaljer',
    'In the volume discounts board, display the new price with the applied discount instead of showing the discount (ie. "-5%").' => 'Visa det nya priset med tillämpad rabatt istället för att visa rabatten i mängdrabattsboxen, (t.ex. "-5%").',
    'Display the "%add_to_cart_label%" button when a product has attributes' => 'Visa knappen  "%add_to_cart_label%" när produkten har attribut',
    'Display or hide the "%add_to_cart_label%" button on category pages for products that have attributes forcing customers to see product details.' => 'Visa eller dölja  "%add_to_cart_label%"-knappen på kategorisidor för produkter som har attribut för att tvinga kunderna att se produktens detaljer.',
    'If an attribute is not available in every product combination, it will not be displayed.' => 'Om ett attribute inte är tillgängligt för varje kombination, så kommer det inte att visas.',
    'Number of products displayed per page. Default is 10.' => 'Produkter som visas per sida. Standard är 10.',
    'The order in which products are displayed in the product list.' => 'Standard beställning genom att till produktlista',
    'Default order method for product list.' => 'Standardsortering  för produktlista.',
    'By default, the Add to Cart button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'Som standard, så är Lägg i varukorgs knappen gömd när produkten inte är tillgänglig. Du kan välja att den visas i alla fall.',
    'Advised for European merchants to be legally compliant (eg: Delivered within 3-4 days)' => 'Förordas för handlare inom EU för att vara förenlig med lag (t. ex: Levereras inom 3-4 dagar)',
    'Advised for European merchants to be legally compliant (eg: Delivered within 5-7 days)' => 'Förordas för handlare inom EU för att vara förenlig med lag (t. ex: Levereras inom 5-7 dagar)',
    'When selling packs of products, how do you want your stock to be calculated?' => 'Vid försäljning av förpackningar av produkter, hur vill du att ditt lager beräknas?',
    'By default, the "%add_to_cart_label%" button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'Som standard, så är  "%add_to_cart_label%"-knappen gömd när produkten inte är tillgänglig. Du kan välja att den visas i alla fall.',
    'Allows you to delay shipping at your customers\' request.' => 'Låter dig fördröja leveransen om kunden så önskar.',
    'Invalid characters: numbers and' => 'Ogiltiga tecken: siffror och',
    'Status will be highlighted in this color. HTML colors only.' => 'Statusen kommer att bli markerad med denna färg. HTML färger endast',
    'Order\'s return status name.' => 'Orderreturers statusnamn',
    'Order status (e.g. \'Pending\').' => 'Beställningstatus (t.ex. väntande).',
    'You can search for a new domain name or add a domain name that you already own. You will be redirected to your PrestaShop account.' => 'Du kan söka efter ett nytt domännamn som du redan äger. Du kommer att bli omdirigerad till ditt PrestaShop-konto.',
    'Invalid characters:' => 'Ogiltiga tecken:',
    'Name of the related page.' => 'Namn på relaterad sida.',
    'Title of this page.' => 'Titeln på denna sida.',
    'A short description of your shop.' => 'En kort beskrivning.',
    'List of keywords for search engines.' => 'Lista över nyckelord för sökmotorer.',
