    '<b>Warning: You cannot use this tool to upgrade your store anymore.</b><br /><br />You already have <b>PrestaShop version %version% installed</b>.<br /><br />If you want to upgrade to the latest version, please read our documentation: <a href="%doc%">%doc%</a>' => '<b>Varning: Du kan inte använda det här verktyget längre för att uppgradera din butik.</b><br /><br />Du har redan <b>PrestaShop version %version% installerad</b>.<br /><br />Om du vill uppgradera till senaste version, läs vår dokumentation: <a href="%doc%">%doc%</a>',
    'Welcome to the PrestaShop %version% Installer' => 'Välkommen till installationen för PrestaShop %version%',
    'Installing PrestaShop is quick and easy. In just a few moments, you will become part of a community consisting of more than 250,000 merchants. You are on the way to creating your own unique online store that you can manage easily every day.' => 'Att installera PrestaShop går snabbt och är enkelt. På bara några få steg blir du en del av gemenskapen som består av mer än 250,000 e-handlare. Du är på väg att skapa din egen unika e-butik som du enkelt administrerar varje dag.',
    'If you need help, do not hesitate to <a href="%tutoriellink%" target="_blank">watch this short tutorial</a>, or check <a href="%linkdoc%" target="_blank">our documentation</a>.' => 'Om du behöver hjälp, tveka inte att <a href="%tutoriellink%" target="_blank">titta på den här instruktionen</a>, eller kolla <a href="%linkdoc%" target="_blank">vår dokumentation</a>.',
    'Continue the installation in:' => 'Fortsätt med installationen på:',
