  'ModulesPagesnotfoundAdmin' => 
  array (
    'Pages not found' => 'Sidan hittades inte',
    'Adds a tab to the Stats dashboard, showing the pages requested by your visitors that have not been found.' => 'Lägger till en flik under Stats som visar sidor som besökare försökt att nå, men som inte hittats.',
