    'Guide' => 'Guide',
    '404 errors' => '404-fel',
    'A 404 error is an HTTP error code which means that the file requested by the user cannot be found. In your case it means that one of your visitors entered a wrong URL in the address bar, or that you or another website has a dead link. When possible, the referrer is shown so you can find the page/site which contains the dead link. If not, it generally means that it is a direct access, so someone may have bookmarked a link which doesn\'t exist anymore.' => 'Ett 404-fel är en HTTP-felkod som uppstår när en besökare efterfrågar en sida som inte kan hittas. I ditt fall betyder det att en av dina besökare knappat in en felaktig URL i adressfältet, eller du eller en annan sajt har en död länk. Om det är möjligt, så kan källan härledas och den döda länken visas. Om inte, så betyder det generellt att besöket var ett direkt besök och att någon kanske har bokmärkt en länk som inte längre finns.',
    'How to catch these errors?' => 'Hur att fånga dessa fel?',
    'If your webhost supports .htaccess files, you can create one in the root directory of PrestaShop and insert the following line inside: "%s".' => 'Om ditt webbhotell har stöd för htaccess-fil kan du skapa den i rotkatalogen och infoga följande rad i filen: "%s".',
    'A user requesting a page which doesn\'t exist will be redirected to the following page: %s. This module logs access to this page.' => 'En besökare som försöker nå en sida som inte finns, kommer att skickas vidare till följande sida: %s. Den här modulen loggar åtkomsten till denna sida.',
