    'Number of customer accounts created' => 'Antal kundkonton som skapats',
    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track. You feel me?' => 'Det totala antalet nya konton är inte i sig viktig information. Däremot är det fördelaktigt att analysera antalet skapade över tid. Detta kommer att ange om saker är på rätt väg.',
    'How to act on the registrations\' evolution?' => 'Hur man ska agera på utveckling av kundregistreringar?',
    'If you let your shop run without changing anything, the number of customer registrations should stay stable or show a slight decline.' => 'Om du inte gör ändringar i din shop, bör antalet kundregistreringar förbli stabila eller minska något.',
    'A significant increase or decrease in customer registration shows that there has probably been a change to your shop. With that in mind, we suggest that you identify the cause, correct the issue and get back in the business of making money!' => 'En betydande ökning eller minskning visar att det förmodligen har skett en förändring i din shop. Det kan vara viktigt att identifiera förändringen om registreringarna minskar i antal.',
    'Here is a summary of what may affect the creation of customer accounts:' => 'Här är sammanfattning av vad som kan påverka skapandet av våra kunders konton:',
    'An advertising campaign can attract an increased number of visitors to your online store. This will likely be followed by an increase in customer accounts and profit margins, which will depend on customer "quality." Well-targeted advertising is typically more effective than large-scale advertising... and it\'s cheaper too!' => 'En reklamkampanj kan locka ett större antal besökare. Detta ger en trolig ökning av kundkonton och vinstmarginal, beroende på kundernas "kvalitet". Målinriktade reklam kan vara mer effektivt än bred reklam!',
    'Specials, sales, promotions and/or contests typically demand a shoppers\' attentions. Offering such things will not only keep your business lively, it will also increase traffic, build customer loyalty and genuinely change your current e-commerce philosophy.' => 'Erbjudanden, rea eller tävlingar drar vanligtvis uppmärksamhet och nyfikenhet. Detta ger din butik liv, öka trafiken och kundlojalitet.',
    'Design and user-friendliness are more important than ever in the world of online sales. An ill-chosen or hard-to-follow graphical theme can keep shoppers at bay. This means that you should aspire to find the right balance between beauty and functionality for your online store.' => 'Design och användarvänlighet är viktigare än någonsin: ett illa valt eller svåra att följa grafiskt tema kan stänga av besökare. Du bör hitta rätt balans mellan en innovativ design och låta besökarna röra sig lätt. Korrekt stavning och tydlighet inspirerar också mer kundernas förtroende för din butik.',
    'CSV Export' => 'CSV-export',
    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track.' => 'Det totala antalet nya konton är inte i sig viktig information. Däremot är det praktiskt att analysera antalet skapade konton över tid. Detta kommer att ange om saker är på rätt väg.',
  ),
